UWAGA , WAŻNE :
Rap (piosenka) jest wykonana przez Damiano0092AFTER. Jeśli się podbała zachęcam do odwiedzenia jego kanału , natomiast teledysk został wykonany przeze mnie. Cóż , to mój 1 raz jeśli chodzi o teledyski , ale myślę , że wyszło dość znośnie. Przesiedziałem nad tym kilka godzin , dlatego też proszę o uszanowanie pracy i o zostawienie oceny i komentarza.

Troche kiepsko wyglądają przybliżenia , ale po prostu nie dysponuję na razie Vegasem ;_;
